INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1001, 1, 0, 0, 0, "春咲 ひより", 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1002, 1, 0, 0, 0, "草野 優衣", 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1003, 1, 0, 0, 0, "士条 怜", 1, 0, "少しは磨かれると思いますよ。", 0, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1004, 1, 0, 0, 0, "穂高 みそぎ", 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1006, 1, 0, 0, 0, "風宮 あかり", 1, 0, "私といっしょに…\nいかない？", 0, "ねぇ…", "風宮あかりです", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1007, 1, 0, 0, 0, "出雲 宮子", 1, 0, "食べ物の恨みは怖いのー", 0, "プリンたべたいのー", "出雲宮子なのー", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1008, 1, 0, 0, 0, "虹村 雪", 1, 0, "いいよ。\n見られることは運命さ…", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1009, 1, 0, 0, 0, "柊杏奈", 1, 0, "人呼んで「疾風の冥姫」!!", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1010, 1, 0, 0, 0, "姫宮 真歩", 1, 0, "ほんまおおきにやわ～♪", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1011, 1, 0, 0, 0, "衣之咲 璃乃", 1, 0, "ここで会ったが\n100年目～！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1012, 1, 0, 0, 0, "柏崎 初音", 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1016, 1, 0, 0, 0, "美波 鈴奈", 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1017, 1, 0, 0, 0, "喜屋武 香織", 1, 0, "でも、沖縄もとってもいいとこさー", 0, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1018, 1, 0, 0, 0, "支倉 伊緒", 1, 0, "イオちゃんって呼んでね。", 0, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1020, 1, 0, 0, 0, "茜 ミミ", 1, 0, "ミミをおいてかないでぇ～", 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1021, 1, 0, 0, 0, "栗林 くるみ", 1, 0, "ふぇぇぇぇぇん……", 0, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1022, 1, 0, 0, 0, "風宮 より", 1, 0, "なんてありがとうございます！", 0, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1023, 1, 0, 0, 0, "北条 綾音", 1, 0, "私こっち行きたいー\nね、早く早くー", 0, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1025, 1, 0, 0, 0, "天野 すずめ", 1, 0, "これて何か違う…\nあああすみません！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1027, 1, 0, 0, 0, "倉石 恵理子", 1, 0, "離しませんわ………\n絶対に…!!", 0, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1028, 1, 0, 0, 0, "佐々木 咲恋", 1, 0, "…そうでしょ？？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1029, 1, 0, 0, 0, "桜井 望", 1, 0, "あはは、\n私もまだまだだなぁ～", 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1030, 1, 0, 0, 0, "ニノン・ジュベール", 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1031, 1, 0, 0, 0, "上喜 しのぶ", 1, 0, "おかしいですね……", 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1033, 1, 0, 0, 0, "野戸まひる", 1, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1034, 1, 0, 0, 0, "綾瀬 ゆかり", 1, 0, "ちょ\nちょっと一杯飲んできます…！", 0, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1036, 1, 0, 0, 0, "氷川 鏡華", 1, 0, "これ以上お話しすることは…\nないです！", 0, "知らない人とは話しちゃいけないので", "氷川鏡華…です", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1038, 1, 0, 0, 0, "柏崎 栞", 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "……あ、アラーム。", "柏崎…栞です。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1040, 1, 0, 0, 0, "双葉 碧", 1, 0, "野に咲く花が、\n唯一の話相手です。", 0, "私、一人も友達がいなくて……", "ふ、双葉碧です。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1042, 1, 0, 0, 0, "三角 千歌", 1, 0, "そう思っています。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1043, 1, 0, 0, 0, "安芸 真琴", 1, 0, "う、疑ってすまなかったな…", 0, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1044, 1, 0, 0, 0, "イリヤ・オーンスタイン", 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1045, 1, 0, 0, 0, "遠見 空花", 1, 0, "ｌク、クウカに何かご用ですか!?", 0, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1046, 1, 0, 0, 0, "宮坂たまき", 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1048, 1, 0, 0, 0, "大神 美冬", 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "それでは早速クエストに…", "大神美冬よ！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1049, 1, 0, 0, 0, "星野静流", 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 2, 1.4, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1050, 1, 0, 0, 0, "玉泉美咲", 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1052, 1, 0, 0, 0, "リマ", 1, 0, "？？？？", 0, "？？？？", "？？？", 2, 1.4, 1);
