INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1058, 1, 0, 0, 0, "ペコリーヌ", 1, 0, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 2, 1.5, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1059, 1, 0, 0, 0, "コッコロ", 1, 0, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 2, 1.5, 1);
